import { Link } from "react-router-dom";
import {
  Box,
  TextField,
  MenuItem,
  FormControl,
  Typography,
  Grid,
  Divider,
  Chip,
} from "@mui/material";
import { LoadingButton } from "@mui/lab";

const LoginPage = () => {
  return (
    <>
      <Typography>Green Cells</Typography>
      <Box
        component="div"
        sx={{
          display: "flex",
          flexDirection: "column",
          flexWrap: "wrap",
          maxWidth: 400,
          border: ".1px solid lightgray",
          borderRadius: ".3rem",
        }}
        mt={2}
        ml="auto"
        mr="auto"
        p={4}
        gap={2}
      >
        <Typography variant="h4" fontWeight="bold">
          Conectare
        </Typography>

        <LoadingButton
          variant="contained"
          loadingPosition="center"
          sx={{
            fontSize: "1rem",
            alignSelf: "flex-strech",
            textTransform: "capitalize",
            backgroundColor: "primary.main",
            "&:hover": { backgroundColor: "primary.dark" },
          }}
        >
          Conectare
        </LoadingButton>
      </Box>
      <Box
        component="div"
        sx={{
          display: "flex",
          flexDirection: "column",
          flexWrap: "wrap",
          textAlign: "center",
          maxWidth: 400,
          border: ".1px solid lightgray",
          borderRadius: ".3rem",
        }}
        mt={2}
        ml="auto"
        mr="auto"
        p={2}
      >
        <Typography variant="body1" component="span" fontWeight={500}>
          Nu ai un cont?{" "}
          <Link to="/register">
            <Typography
              sx={{ color: "primary.main" }}
              variant="body1"
              component="span"
            >
              CreazÄƒ cont nou
            </Typography>
          </Link>
          .
        </Typography>
      </Box>
    </>
  );
};

export default LoginPage;
